import React from "react";
import { Link } from 'react-router-dom';

function About() {
  return (
    <>
      <div>
        <section>
          <h2>Welcome to ReNewCycle Project</h2>
        </section>
      </div>
      <div className="about-us">
        <h2>About Us</h2>
        <p>
          Our team, comprised of students from the University of Washington, under the sponsorship of Yekaterina Yefimova, is dedicated to empowering Hispanic communities in the Tri-Cities area of Washington. These communities often lack access to essential digital resources, including high-speed Internet and computer skills. With our own experiences as underrepresented backgrounds in mind, we meticulously designed this website to cater to the needs of our users.
        </p>

        <p>
          Within our site, users will discover an array of tools tailored for individuals looking to implement digital literacy programs. We included features such as an interactive map highlighting crucial infrastructures like libraries and nearby nonprofit organization offices, budgeting tips, and workshops aimed at enhancing leadership skills. While certain features, such as our interactive map, are specific to the Tri-Cities area, we strive to provide valuable information for all users navigating the realm of digital literacy. It's important to note that our project is ongoing, with continual updates and improvements underway.
        </p>
      </div>
    </>
  );
}

export default About;
